class Solution(object):
	def findMaximumXOR(self, nums):
		"""
		:type nums: List[int]
		:rtype: int
		"""
		from itertools import combinations
		res = 0
		for tmp in combinations(nums, 2):
			# print(tmp)
			val = tmp[0] ^ tmp[1]
			res = max(val, res)
		return res


